{'pk': 17920304119114737, 'user_id': 2254231286, 'text': '#Recomendado
Este libro se compone de dos textos escritos con treinta y cinco aﾃｱos de diferencia. El segundo, dedicado a su madre, ya se habia publicado en 1986 de forma autﾃｳnoma. El primero, centrado en la figura de su padre, es reciente e inedito. ﾂｿQuﾃｩ historias se nos relatan en este volumen? Las de dos jovenes de Arkansas, en el corazon de Estados Unidos profundo: Parker y Edna, que se casan en 1928 y tienen un hijo, el autor, en 1944. La historia de un hombre de caracter bondadoso que se gana la vida como viajante de comercio, pasa mucho tiempo en la carretera, fuera de casa, y muere de un ataque al corazon cuando Ford tiene solo dieciseis aﾃｱos. La historia de una chica con un pasado complicado y un secreto, que quedo viuda a los cuarenta y tuvo que mantener a su hijo.

