{'pk': 17847878629239451, 'user_id': 2254231286, 'text': "#Novedad 'La transparencia del tiempo' de #leonardopadura ﾂ｡Vuelve Mario Conde!

A un Mario Conde a punto de cumplir sesenta aﾃｱos, y que se siente mﾃ｡s en crisis y mﾃ｡s escﾃｩptico que de costumbre con su paﾃｭs, le llega de manera inesperada un encargo de un antiguo amigo del instituto, Bobby, que le pide ayuda para recuperar la estatua de una virgen negra que le han robado. Conde descubre que esa pieza es mucho mﾃ｡s valiosa de lo que le han dicho, y su amigo tiene que confesarle que proviene de su abuelo espaﾃｱol, que, huyendo de la Guerra Civil, la trajo de una ermita del Pirineo catalﾃ｡n. En los bajos fondos de La Habana, Conde da con un sospechoso al que acaban matando. Con el asesinato de otro cﾃｳmplice, Conde descubre una inesperada trama de galeristas y coleccionistas extranjeros interesados en la talla medieval, y se tropieza inevitablemente con la policﾃｭa de homicidios de La Habana. Pero, en capﾃｭtulos intercalados,\xa0La transparencia del tiempo\xa0tambiﾃｩn cuenta la epopeya a lo largo de los siglos de la estatua, una virgen negra traﾃｭda de la ﾃｺltima cruzada a una ermita del Pirineo por un tal Antoni Barral, y serﾃ｡ otro Antoni Barral quien la salve y se vea obligado a embarcar como polizﾃｳn rumbo a La Habana.

